import React,{Component} from 'react';
import './App.css';
import LandingPage from './Components/LandingPage';
import About from './Components/About';
import Timeline from './Components/Timeline';
import Contact from './Components/Contact'; 
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar } from 'react-bootstrap';
import {Link} from 'react-scroll';



class App extends Component{
  render(){
    return (
      <main>
        <Navbar bg="dark" variant="dark" sticky="top">
            <Navbar.Brand>SAKET CHINCHALIKAR</Navbar.Brand>
            <Nav>
          <Link style={{color:'white', margin:'auto'}} activeClass="active" href="abt" spy={true} smooth={true} offset={0} duration= {1000}>ABOUT ME</Link>
          <Nav.Link style={{color:'white', margin:'auto'}} activeClass="active" to="abt" spy={true} smooth={true} offset={0} duration= {1000}>ABOUT</Nav.Link>
          <Link style={{color:'white', margin:'auto'}} activeClass="active" to="timeline" spy={true} smooth={true} offset={0} duration= {1000}>TIMELINE </Link>                
          <Link style={{color:'white', margin:'auto'}} activeClass="active" to="contact" spy={true} smooth={true} offset={0} duration= {1000}>CONTACT </Link>   
        </Nav>
        </Navbar>

        <LandingPage />
        <About/>
        <Timeline/>
        <Contact/>
        <a style={{color: 'black'}} href="https://www.facebook.com/saket.chinchalikar.1" rel="noopener noreferrer" target="_blank">
        <i className="fa fa-facebook-square" aria-hidden="true" /></a>

        <a style={{color: 'black'}} href="https://www.linkedin.com/in/saket-chinchalikar/" rel="noopener noreferrer" target="_blank">
        <i className="fa fa-linkedin" aria-hidden="true" /></a>

        <a style={{color: 'black'}} href="https://www.instagram.com/saket9_c/" rel="noopener noreferrer" target="_blank">
        <i className="fa fa-instagram" aria-hidden="true" /></a>

        <a style={{color: 'black'}} href="https://github.com/saketc095" rel="noopener noreferrer" target="_blank">
        <i className="fa fa-github" aria-hidden="true" /></a>
      </main>        
    );
  } 
}
export default App;
